    const checkButtonSytle = STYLES.includes(buttonStyle) ? buttonStyle : STYLES[0];

    const checkButtonSize = SIZES.includes(buttonSize) ? buttonSize : SIZE[0];

    return (
        <link to='/sign-up' className='btn-mobile'>
            <botton
                classNmae={`btn ${checkButtonStyle} ${checkButtonSize}`}
                onClick={onClick}
                type={type}
